import React from 'react';
import profilePicture from "../../images/me.svg";

function About() {
    return (
        <section className="main main__about">
            <main className="about__container">
                <article className="profile__picture">
                    <img src={profilePicture} alt="Picture of me" />
                </article>
                <div className="profile__info">

                </div>
            </main>
        </section>
    );
}

export default About;
